CREATE TABLE "NMT2"."ACTIONCONTEXT"
(
    ACTIONCONTEXT varchar2(50) PRIMARY KEY NOT NULL,
    FROM_ROLE varchar2(50) NOT NULL,
    SERVICE varchar2(50) NOT NULL,
    ACTION varchar2(50) NOT NULL,
    MELDINGSTYPE varchar2(50),
    TO_ROLE varchar2(50) NOT NULL
);
CREATE UNIQUE INDEX RSA_UK1 ON "ACTIONCONTEXT"
(
  FROM_ROLE,
  SERVICE,
  ACTION
);


